import React from 'react';
import {Box,Grid,Avatar,Stack} from "@mui/material";
const Footer = () => {
    return (
        <>
            <Box sx={{width:"100vw",bgcolor:"#333333"}}>
   <Grid container alignItems="center"
  justifyContent="center" spacing={2} >

    <Grid item >
    <Stack direction="row" spacing={2}>
      <Avatar alt="Remy Sharp" src="https://cdn3.iconfinder.com/data/icons/free-social-icons/67/facebook_circle_color-256.png" />
      <Avatar alt="Travis Howard" src="https://cdn2.iconfinder.com/data/icons/social-icons-33/128/Instagram-256.png" />
      <Avatar alt="Cindy Baker" src="https://cdn2.iconfinder.com/data/icons/social-media-2285/512/1_Twitter3_colored_svg-256.png" />
    </Stack>

    </Grid>


  </Grid>
            </Box>
        </>
    )
}

export default Footer;
